import React, { Component } from "react";

class TeamMember extends Component {
    render() {
        return(
            <div className = "col-lg-4 col-md-6 col-sm-6 col-xs-12">
                <div className = "card">
                    <img style = {{maxWidth : '100%'}} src = {props.img}/>
                
                    <div className="card-body center" style = {{backgroundColor : props.website ? 'white' : 'gray'}}>
                        <h2 className="text-width"> {props.name} </h2>
                        <h5> {props.position} </h5>
                        <div> {props.phone} </div>
                        <div> {props.email} </div>
                        <h6> {props.website} </h6>
                    </div>
                </div>
            </div>
        );
    }
}

export default TeamMember;
